import React, { Component } from 'react'

class TickerList extends Component {
    constructor(props) {
        super(props)

        this.state = {

        }
    }

    render() {

        const tickerList = [{'a':'b', 'c': 'd'}]

        const tickerMap = tickerList.map((ticker) => [
            <li>{ticker}</li>
        ])
        return (
            <div className="ticker-app-container">
                {tickerMap}
            </div>
        )
    }
}

export default TickerList
